import React from "react";
import { Navigate, Outlet } from "react-router-dom";

const PrivateRootUser = ({ roleUser }) => {
  return <div>{roleUser ? <Outlet /> : <Navigate to="/" />}</div>;
};

export default PrivateRootUser;
